(374, 1, '2017-07-28 07:49:40', '2017-07-28 07:49:40', '気さくな美容師さんが対応してくださりとても楽しい時間を過ごせました！いつもは髪を切り終わった後鏡でこれでいいか確認する時、「ここを直して欲しい」\r\nという髪型の箇所があってもあまり言えずにそのままにしていたのですが、美容師さんがとても親身に対応してくれていたので気軽に要望を言うこともでき\r\nて始めて美容院で希望通りの髪型になりました。親身に接してくださったり、とても面白いお姉さんとお兄さん、ありがとうございました！次はカラーをお願い\r\nしたいと思っています。', 'いけごろうさん（女性/10代後半/学生)', '', 'publish', 'closed', 'closed', '', 'voice-1-his-will-not-work-if-the-iframe-contains-content-from-another-domain-because-of-t', '', '', '2017-08-03 04:26:14', '2017-08-03 04:26:14', '', 0, 'http://localhost/wpe/?post_type=voice&#038;p=374', 0, 'voice', '', 0),
(375, 1, '2017-07-28 07:50:10', '2017-07-28 07:50:10', '人見知りな性格の自分ですが、全く気を遣うことがなく居心地よく施術してもらうことができました。人に会うのが嫌で自分で長年切っていた髪も、これから\r\nはこちらに託すことに決めました。ちなみに、私は髪質が針金のように硬く扱いにくいのですが、当店の方はまるでマシュマロを転がすかのような手さばき\r\nで綺麗に仕上げてくれました。感謝です。', 'クロレッツさん（男性/20代後半/その他)c', '', 'publish', 'closed', 'closed', '', 'voice-2', '', '', '2017-08-03 04:26:48', '2017-08-03 04:26:48', '', 0, 'http://localhost/wpe/?post_type=voice&#038;p=375', 0, 'voice', '', 0),
(376, 1, '2017-07-28 07:50:39', '2017-07-28 07:50:39', '以下のフォームにご記入のうえ、「入力内容確認」ボタンを押してください。\r\n*は必須入力欄です。必ず記入してください。半角カナは使用しないで下さい。\r\n注：入力エラーになる場合には次のメールアドレスに直接お問い合わせください。', 'あなたの声（お問合せなどもこちらにお願いします）', '', 'publish', 'closed', 'closed', '', 'voice-3', '', '', '2017-08-03 04:27:24', '2017-08-03 04:27:24', '', 0, 'http://localhost/wpe/?post_type=voice&#038;p=376', 0, 'voice', '', 0);
