(504, 1, '2017-08-03 03:05:14', '2017-08-03 03:05:14', '<h4 class="post-title">28日（水）ＦＭぱるるん『Precious プレシャス』で北野エース水戸エクセルみなみ店の</h4>\r\n<h4 class="post-title">28日（水）ＦＭぱるるん『<img src="https://www.ace-group.co.jp/FileData/ckfinder/images/20170703_F348BAF8BF6CAFD2.jpg" alt="6月28日（水）ＦＭぱるるん『Precious プレシャス』で北野エース水戸エクセルみなみ店の商品が紹介されました。" /></h4>\r\n6月28日（水）13時から放送のＦＭぱるるん『Precious プレシャス』の中「カレーＶＳラーメン」の企画で、水戸エクセルみなみ店が紹介されました。\r\n瀬ノ上店長がレポーターのインタビューに答え、「カレーなる本棚」とインスタントラーメンの紹介がありました。\r\n\r\n紹介された商品ーーーーーーーーーーーー\r\n【カレー編】\r\n<strong>人気のカレー</strong>\r\n1位　大人のためのビーフカレー\r\n2位　寿フーズ　北海道スープカレー\r\n3位　ＧＯＧＯカレー\r\n\r\n<strong>瀬上店長おススメ</strong>\r\n・カクキュー八丁味噌カレー\r\nPrecious プレシャス』で北野エース水戸エクセルみなみ店の', '28日（水）ＦＭぱるるん『Precious プレシャス』で北野エース水戸エクセルみなみ店の', '', 'publish', 'closed', 'closed', '', '28%e6%97%a5%ef%bc%88%e6%b0%b4%ef%bc%89%ef%bd%86%ef%bd%8d%e3%81%b1%e3%82%8b%e3%82%8b%e3%82%93%e3%80%8eprecious-%e3%83%97%e3%83%ac%e3%82%b7%e3%83%a3%e3%82%b9%e3%80%8f%e3%81%a7%e5%8c%97%e9%87%8e%e3%82%a8', '', '', '2017-08-03 03:58:05', '2017-08-03 03:58:05', '', 0, 'http://localhost/wpe/?post_type=stylee1&#038;p=504', 0, 'stylee1', '', 0),
