(507, 1, '2017-08-03 03:08:31', '2017-08-03 03:08:31', '<h4 class="post-title">2017年 北野エース「福袋」がまもなく発売！</h4>\r\n<p class="post-date">2016.12.27</p>\r\n\r\n<div class="content"><img src="https://www.ace-group.co.jp/FileData/ckfinder/images/20161214_E8FC522CDB0B6091.jpg" alt="" />\r\n\r\n毎年、年越し・お正月にご好評頂いているのが、北野エース「福袋」です！\r\n今年は、全国68店舗のエースグループ各店で発売いたします。 今年も福袋の内容、種類、限定数量など店舗によって違います。おかげ様で、昨年も完売している商品なので、お早めのお買い求めをおススメします。\r\n発売店舗、内容などの詳細は、下記の表または各店舗情報をごらんください。\r\n<div>\r\n<div>\r\n<table cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td align="center"><strong>店名</strong></td>\r\n<td align="center"><strong>発売日</strong></td>\r\n<td align="center"><strong>内容</strong></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<div>\r\n<table cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td align="center"><strong>北海道</strong></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<div>\r\n<table border="0" width="100%" cellspacing="0" cellpadding="5">\r\n<tbody>\r\n<tr>\r\n<td><strong>北野エース フィール旭川店</strong>\r\n北海道旭川市一条通8丁目108番地\r\nフィール旭川地下1階\r\n区画番号W0221\r\n03-5608-1757</td>\r\n<td>1月1日\r\n（先着順販売）</td>\r\n<td>●チーズ福袋 2160円\r\n●お菓子福袋 2160円\r\nＫＳｽｲｰﾂｱｿｰﾄ、ＫＳ炭焼珈琲ゼリー、ＫＳｸｰﾍﾞﾙﾁｭｰﾙﾐﾙｸﾁｮｺ、ＫＳ再仕込み醤油割れしみ煎、ＫＳ無選別えびせん、瀬戸内レモンいか天、二度ぬりふ菓子 2800円相当\r\n●食品福袋 2160円\r\nあごいりだし、諸国名産味噌汁、ＫＳ鍋スープ、ＫＳパンケーキＭＩＸ、ＭＣＣスープ 2800円相当\r\n●白子のり福袋 1080円\r\n●にんべん福袋 1080円</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<div>\r\n<table border="0" width="100%" cellspacing="0" cellpadding="5">\r\n<tbody>\r\n<tr>\r\n<td rowspan="2"><strong>北野エース 帯広藤丸店</strong>\r\n北海道帯広市西二条南8丁目1番地 B1F\r\n0155-66-9761</td>\r\n<td>1月2日\r\n（先着順販売）</td>\r\n<td>●ジャム福袋 1170円\r\n当店人気のジャムやパンケーキミックスなど\r\n●ヘルシー＆ビューティー福袋 3240円\r\nオイルやえごまなど\r\n●ドライフルーツ福袋 2017円\r\n当店人気のドライフルーツ各種\r\n●インスタント麺福袋 2017円\r\n当店人気のインスタント麺やペヤングなど\r\n●お菓子福袋 1080円\r\n当店人気のキタノセレクション菓子\r\n●ごはんにピッタリ和系福袋 1080円\r\n漬物や梅など多彩なご飯のお供</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n</div>', '年 北野エース「福袋」がまもなく発売', '', 'publish', 'closed', 'closed', '', '%e5%b9%b4-%e5%8c%97%e9%87%8e%e3%82%a8%e3%83%bc%e3%82%b9%e3%80%8c%e7%a6%8f%e8%a2%8b%e3%80%8d%e3%81%8c%e3%81%be%e3%82%82%e3%81%aa%e3%81%8f%e7%99%ba%e5%a3%b2', '', '', '2017-08-03 03:08:31', '2017-08-03 03:08:31', '', 0, 'http://localhost/wpe/?post_type=stylee1&#038;p=507', 0, 'stylee1', '', 0),
